import "./HowWeWork.scss";
import woman from "./../assets/HowWeWork/woman.png";
import shield from "./../assets/HowWeWork/shield.svg";

const HowWeWork = () => {
  return (
    <div className="HowWeWork">
      <div className="header">
        <h1>How we work</h1>
        <p>learn online with world's best coaches</p>
      </div>

      <div className="steps">
        <div className="step">
          <div className="left">
            <img src={shield} alt="" />
            <div className="number">1</div>
            <div className="text__box">
              <h2>Find the best coach</h2>
              <p>
                Choose from over 20,000 online coaches. Use filters to narrow
                your search and find the perfect fit
              </p>
            </div>
          </div>
          <img src={woman} alt="" />
        </div>
      </div>
    </div>
  );
};

export default HowWeWork;
